window.bookSummaryJSON = "<p><b>Welcome to the conclusion of the tantalizing romance of Erik and Livia.</b></p> <p><b>The Songbird</b></p> <p>Captive. Challenger. Queen.</p> <p>Enemies took her from the man who held her heart. They might see her as weak, as a pawn in wicked games, but they're no match for the first Ever Queen.</p> <p>Let them think they've won. Her heart belongs to a beautiful monster, and she will never stop fighting until she's back in his arms.</p> <p><b>The Serpent</b></p> <p>Captor. Villain. King.</p> <p>His enemies stole the woman who claimed his soul. They betrayed him out of greed and desire for the crown, but they won't die for that betrayal. No. They'll die for touching her.</p> <p>His heart belongs to a stunning little bird. He will never stop searching for her light across the skies. Not until the blood of his enemies spills at her feet, and his queen wears their bones around her neck.</p> <p><i>Welcome back to the world of the Ever Kingdom where pirates collide with Vikings in passionate romance, brutal battles, and an unforgettable dark fantasy world. This book concludes the love story between Erik and Livia, but new, standalone romances with other favorite characters will continue to build the world.</i></p>"; 
